import React from 'react';
import { DataGrid } from '@material-ui/core';

const Table = () => {
const columns = [
  { field: 'id', 
    headerName: 'ID', 
    width: 70 },
  { field: 'name', 
    headerName: 'Name', 
    width: 130 },
  { field: 'email', 
    headerName: 'Email', 
    type: 'email',
    width: 130 },
  {
    field: 'group',
    headerName: 'Group',
    width: 130,
  },
  {
    field: 'customer',
    headerName: 'Customer',
    width: 130,
  },
];

const rows = [
  { id: 1, name: 'Snow', email: '123@gmail.com'},
  { id: 2, name: 'Snow', email: '123@gmail.com'},
  { id: 3, name: 'Snow', email: '123@gmail.com'},
  { id: 4, name: 'Snow', email: '123@gmail.com'},
  { id: 5, name: 'Snow', email: '123@gmail.com'},,
  { id: 6, name: 'Snow', email: '123@gmail.com'},
  { id: 7, name: 'Snow', email: '123@gmail.com'},
  { id: 8, name: 'Snow', email: '123@gmail.com'},
  { id: 9, name: 'Snow', email: '123@gmail.com'},
];

  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
export default Table
